import React, { useState, useEffect } from "react";
import "./App.css";
import io from "socket.io-client";

const socket = io("http://localhost:5000");

const App = () => {
  const [config, setConfig] = useState({
    totalTickets: "",
    releaseRate: "",
    retrievalRate: "",
    maxCapacity: "",
  });

  const [ticketData, setTicketData] = useState({
    totalTickets: 0,
    maxTickets: 0,
    sellingTickets: 0,
    remainingTickets: 0,
  });

  const [isRunning, setIsRunning] = useState(false);

  useEffect(() => {
    socket.on("updateTickets", (data) => {
      setTicketData({
        sellingTickets: data.sellingTickets,
        remainingTickets: data.remainingTickets,
        totalTickets: config.totalTickets,
        maxTickets: config.maxCapacity,
      });
    });

    socket.on("error", (msg) => {
      alert(`Error: ${msg}`);
    });

    return () => socket.disconnect();
  }, [config]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setConfig((prev) => ({ ...prev, [name]: value }));
  };

  const handleSave = () => {
    const { totalTickets, releaseRate, retrievalRate, maxCapacity } = config;

    if (!totalTickets || !releaseRate || !retrievalRate || !maxCapacity) {
      alert("All fields are required.");
      return;
    }

    socket.emit("configure", config, (response) => {
      if (response.error) {
        alert(response.error);
      } else {
        setTicketData({
          totalTickets,
          maxTickets: maxCapacity,
          sellingTickets: 0,
          remainingTickets: totalTickets,
        });
        alert("Configuration saved successfully!");
      }
    });
  };

  const handleStart = () => {
    if (isRunning) return;
    setIsRunning(true);
    socket.emit("start", config, (response) => {
      if (response.error) {
        alert(response.error);
        setIsRunning(false);
      } else {
        alert("Operations started!");
      }
    });
  };

  const handleStop = () => {
    if (!isRunning) return;
    setIsRunning(false);
    socket.emit("stop", null, (response) => {
      if (response.error) {
        alert(response.error);
      } else {
        alert("Operations stopped!");
      }
    });
  };

  const handleReset = () => {
    setIsRunning(false);
    setTicketData({
      totalTickets: 0,
      maxTickets: 0,
      sellingTickets: 0,
      remainingTickets: 0,
    });
    socket.emit("reset", null, (response) => {
      if (response.error) {
        alert(response.error);
      } else {
        alert("System reset!");
      }
    });
  };

  return (
    <div className="app">
      <header className="header">
        <h1>Ticket Management System</h1>
      </header>

      <div className="main-content">
        {/* Configuration Section */}
        <div className="box config-box">
          <h2>Configuration</h2>
          <form>
            <label>
              Total Tickets:
              <input
                type="number"
                name="totalTickets"
                value={config.totalTickets}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Ticket Release Rate (sec):
              <input
                type="number"
                name="releaseRate"
                value={config.releaseRate}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Customer Retrieval Rate (sec):
              <input
                type="number"
                name="retrievalRate"
                value={config.retrievalRate}
                onChange={handleInputChange}
              />
            </label>
            <label>
              Max Ticket Capacity:
              <input
                type="number"
                name="maxCapacity"
                value={config.maxCapacity}
                onChange={handleInputChange}
              />
            </label>
            <div className="button-group">
              <button type="button" onClick={handleSave}>
                Save
              </button>
              <button type="button" onClick={handleReset}>
                Reset
              </button>
            </div>
          </form>
        </div>

        {/* Status Section */}
        <div className="box status-box">
          <h2>Status</h2>
          <p>Total Tickets: {ticketData.totalTickets}</p>
          <p>Max Capacity: {ticketData.maxTickets}</p>
          <p>Selling Tickets: {ticketData.sellingTickets}</p>
          <p>Remaining Tickets: {ticketData.remainingTickets}</p>
        </div>

        {/* Control Panel */}
        <div className="box control-panel">
          <h2>Controls</h2>
          <button onClick={handleStart} disabled={isRunning}>
            Start
          </button>
          <button onClick={handleStop} disabled={!isRunning}>
            Stop
          </button>
        </div>
      </div>
    </div>
  );
};

export default App;
